import React from 'react';
import ReactDOM from 'react-dom';
import { BrowserRouter as Router,Route,Routes} from 'react-router-dom';
import App from './App';

ReactDOM.render(
  <Router>
  <Routes>
      <Route exact path="/" element={<App/>}></Route>
  </Routes>
  </Router>,
  document.getElementById('root')
);
